@testset "5.3.4 u (a+b arctan(c x))^p" begin
    @variables a, b, c, d, e, f, g, m, n, p, q, x

    #= ::Package:: =#

    #= ::Title::Closed:: =#
    #=Integrands*of*the*form*(f*x)^m*(d+e*x)^q*(a+b*atan(c*x))^p=#


    #= ::Section::Closed:: =#
    #=Integrands*of*the*form*x^m*(d+e*x)^q*(a+b*atan(c*x))^p*with*c^2*d^2+e^2=0=#


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*x^m*(d+e*x)^q*(a+b*atan(c*x))^1*with*c^2*d^2+e^2=0=#


    #= ::Subsubsection::Closed:: =#
    #=q>0=#


    @test_int [x^3*(d + im*c*d*x)*(a + b*atan(c*x)), x, 7, (b*d*x)/(4*c^3) + ((im/10)*b*d*x^2)/c^2 - (b*d*x^3)/(12*c) - (im/20)*b*d*x^4 - (b*d*atan(c*x))/(4*c^4) + (d*x^4*(a + b*atan(c*x)))/4 + (im/5)*c*d*x^5*(a + b*atan(c*x)) - ((im/10)*b*d*log(1 + c^2*x^2))/c^4]
    @test_int [x^2*(d + im*c*d*x)*(a + b*atan(c*x)), x, 7, ((im/4)*b*d*x)/c^2 - (b*d*x^2)/(6*c) - (im/12)*b*d*x^3 - ((im/4)*b*d*atan(c*x))/c^3 + (d*x^3*(a + b*atan(c*x)))/3 + (im/4)*c*d*x^4*(a + b*atan(c*x)) + (b*d*log(1 + c^2*x^2))/(6*c^3)]
    @test_int [x*(d + im*c*d*x)*(a + b*atan(c*x)), x, 7, -(b*d*x)/(2*c) - (im/6)*b*d*x^2 + (b*d*atan(c*x))/(2*c^2) + (d*x^2*(a + b*atan(c*x)))/2 + (im/3)*c*d*x^3*(a + b*atan(c*x)) + ((im/6)*b*d*log(1 + c^2*x^2))/c^2]
    @test_int [(d + im*c*d*x)*(a + b*atan(c*x)), x, 4, (-im/2)*b*d*x - ((im/2)*d*(1 + im*c*x)^2*(a + b*atan(c*x)))/c - (b*d*log(im + c*x))/c]
    @test_int [((d + im*c*d*x)*(a + b*atan(c*x)))/x, x, 8, im*a*c*d*x + im*b*c*d*x*atan(c*x) + a*d*log(x) - (im/2)*b*d*log(1 + c^2*x^2) + (im/2)*b*d*PolyLog(2, (-im)*c*x) - (im/2)*b*d*PolyLog(2, im*c*x)]
    @test_int [((d + im*c*d*x)*(a + b*atan(c*x)))/x^2, x, 10, -((d*(a + b*atan(c*x)))/x) + im*a*c*d*log(x) + b*c*d*log(x) - (b*c*d*log(1 + c^2*x^2))/2 - (b*c*d*PolyLog(2, (-im)*c*x))/2 + (b*c*d*PolyLog(2, im*c*x))/2]
    @test_int [((d + im*c*d*x)*(a + b*atan(c*x)))/x^3, x, 4, -(b*c*d)/(2*x) - (d*(1 + im*c*x)^2*(a + b*atan(c*x)))/(2*x^2) + im*b*c^2*d*log(x) - im*b*c^2*d*log(im + c*x)]
    @test_int [((d + im*c*d*x)*(a + b*atan(c*x)))/x^4, x, 4, -(b*c*d)/(6*x^2) - ((im/2)*b*c^2*d)/x - (d*(a + b*atan(c*x)))/(3*x^3) - ((im/2)*c*d*(a + b*atan(c*x)))/x^2 - (b*c^3*d*log(x))/3 - (b*c^3*d*log(im - c*x))/12 + (5*b*c^3*d*log(im + c*x))/12]
    @test_int [((d + im*c*d*x)*(a + b*atan(c*x)))/x^5, x, 4, -(b*c*d)/(12*x^3) - ((im/6)*b*c^2*d)/x^2 + (b*c^3*d)/(4*x) - (d*(a + b*atan(c*x)))/(4*x^4) - ((im/3)*c*d*(a + b*atan(c*x)))/x^3 - (im/3)*b*c^4*d*log(x) + (im/24)*b*c^4*d*log(im - c*x) + ((7*im)/24)*b*c^4*d*log(im + c*x)]


    @test_int [x^3*(d + im*c*d*x)^2*(a + b*atan(c*x)), x, 7, (5*b*d^2*x)/(12*c^3) + ((im/5)*b*d^2*x^2)/c^2 - (5*b*d^2*x^3)/(36*c) - (im/10)*b*d^2*x^4 + (b*c*d^2*x^5)/30 - (5*b*d^2*atan(c*x))/(12*c^4) + (d^2*x^4*(a + b*atan(c*x)))/4 + ((2*im)/5)*c*d^2*x^5*(a + b*atan(c*x)) - (c^2*d^2*x^6*(a + b*atan(c*x)))/6 - ((im/5)*b*d^2*log(1 + c^2*x^2))/c^4]
    @test_int [x^2*(d + im*c*d*x)^2*(a + b*atan(c*x)), x, 7, ((im/2)*b*d^2*x)/c^2 - (4*b*d^2*x^2)/(15*c) - (im/6)*b*d^2*x^3 + (b*c*d^2*x^4)/20 - ((im/2)*b*d^2*atan(c*x))/c^3 + (d^2*x^3*(a + b*atan(c*x)))/3 + (im/2)*c*d^2*x^4*(a + b*atan(c*x)) - (c^2*d^2*x^5*(a + b*atan(c*x)))/5 + (4*b*d^2*log(1 + c^2*x^2))/(15*c^3)]
    @test_int [x*(d + im*c*d*x)^2*(a + b*atan(c*x)), x, 7, (-3*b*d^2*x)/(4*c) - (im/3)*b*d^2*x^2 + (b*c*d^2*x^3)/12 + (3*b*d^2*atan(c*x))/(4*c^2) + (d^2*x^2*(a + b*atan(c*x)))/2 + ((2*im)/3)*c*d^2*x^3*(a + b*atan(c*x)) - (c^2*d^2*x^4*(a + b*atan(c*x)))/4 + ((im/3)*b*d^2*log(1 + c^2*x^2))/c^2]
    @test_int [(d + im*c*d*x)^2*(a + b*atan(c*x)), x, 4, (-(2/3))*im*b*d^2*x - (b*d^2*(1 + im*c*x)^2)/(6*c) - (im*d^2*(1 + im*c*x)^3*(a + b*atan(c*x)))/(3*c) - (4*b*d^2*log(1 - im*c*x))/(3*c)]
    @test_int [((d + im*c*d*x)^2*(a + b*atan(c*x)))/x, x, 11, (2*im)*a*c*d^2*x + (b*c*d^2*x)/2 - (b*d^2*atan(c*x))/2 + (2*im)*b*c*d^2*x*atan(c*x) - (c^2*d^2*x^2*(a + b*atan(c*x)))/2 + a*d^2*log(x) - im*b*d^2*log(1 + c^2*x^2) + (im/2)*b*d^2*PolyLog(2, (-im)*c*x) - (im/2)*b*d^2*PolyLog(2, im*c*x)]
    @test_int [((d + im*c*d*x)^2*(a + b*atan(c*x)))/x^2, x, 13, (-a)*c^2*d^2*x - b*c^2*d^2*x*atan(c*x) - (d^2*(a + b*atan(c*x)))/x + 2*im*a*c*d^2*log(x) + b*c*d^2*log(x) - b*c*d^2*PolyLog(2, (-im)*c*x) + b*c*d^2*PolyLog(2, im*c*x)]
    @test_int [((d + im*c*d*x)^2*(a + b*atan(c*x)))/x^3, x, 13, -(b*c*d^2)/(2*x) - (b*c^2*d^2*atan(c*x))/2 - (d^2*(a + b*atan(c*x)))/(2*x^2) - ((2*im)*c*d^2*(a + b*atan(c*x)))/x - a*c^2*d^2*log(x) + (2*im)*b*c^2*d^2*log(x) - im*b*c^2*d^2*log(1 + c^2*x^2) - (im/2)*b*c^2*d^2*PolyLog(2, (-im)*c*x) + (im/2)*b*c^2*d^2*PolyLog(2, im*c*x)]
    @test_int [((d + im*c*d*x)^2*(a + b*atan(c*x)))/x^4, x, 4, -(b*c*d^2)/(6*x^2) - (im*b*c^2*d^2)/x - (d^2*(1 + im*c*x)^3*(a + b*atan(c*x)))/(3*x^3) - (4*b*c^3*d^2*log(x))/3 + (4*b*c^3*d^2*log(im + c*x))/3]
    @test_int [((d + im*c*d*x)^2*(a + b*atan(c*x)))/x^5, x, 4, -(b*c*d^2)/(12*x^3) - ((im/3)*b*c^2*d^2)/x^2 + (3*b*c^3*d^2)/(4*x) - (d^2*(a + b*atan(c*x)))/(4*x^4) - (((2*im)/3)*c*d^2*(a + b*atan(c*x)))/x^3 + (c^2*d^2*(a + b*atan(c*x)))/(2*x^2) - ((2*im)/3)*b*c^4*d^2*log(x) - (im/24)*b*c^4*d^2*log(im - c*x) + ((17*im)/24)*b*c^4*d^2*log(im + c*x)]
    @test_int [((d + im*c*d*x)^2*(a + b*atan(c*x)))/x^6, x, 4, -(b*c*d^2)/(20*x^4) - ((im/6)*b*c^2*d^2)/x^3 + (4*b*c^3*d^2)/(15*x^2) + ((im/2)*b*c^4*d^2)/x - (d^2*(a + b*atan(c*x)))/(5*x^5) - ((im/2)*c*d^2*(a + b*atan(c*x)))/x^4 + (c^2*d^2*(a + b*atan(c*x)))/(3*x^3) + (8*b*c^5*d^2*log(x))/15 - (b*c^5*d^2*log(im - c*x))/60 - (31*b*c^5*d^2*log(im + c*x))/60]


    @test_int [x^3*(d + im*c*d*x)^3*(a + b*atan(c*x)), x, 7, (3*b*d^3*x)/(4*c^3) + (((13*im)/35)*b*d^3*x^2)/c^2 - (b*d^3*x^3)/(4*c) - ((13*im)/70)*b*d^3*x^4 + (b*c*d^3*x^5)/10 + (im/42)*b*c^2*d^3*x^6 - (3*b*d^3*atan(c*x))/(4*c^4) + (d^3*x^4*(a + b*atan(c*x)))/4 + ((3*im)/5)*c*d^3*x^5*(a + b*atan(c*x)) - (c^2*d^3*x^6*(a + b*atan(c*x)))/2 - (im/7)*c^3*d^3*x^7*(a + b*atan(c*x)) - (((13*im)/35)*b*d^3*log(1 + c^2*x^2))/c^4]
    @test_int [x^2*(d + im*c*d*x)^3*(a + b*atan(c*x)), x, 7, (((11*im)/12)*b*d^3*x)/c^2 - (7*b*d^3*x^2)/(15*c) - ((11*im)/36)*b*d^3*x^3 + (3*b*c*d^3*x^4)/20 + (im/30)*b*c^2*d^3*x^5 - (((11*im)/12)*b*d^3*atan(c*x))/c^3 + (d^3*x^3*(a + b*atan(c*x)))/3 + ((3*im)/4)*c*d^3*x^4*(a + b*atan(c*x)) - (3*c^2*d^3*x^5*(a + b*atan(c*x)))/5 - (im/6)*c^3*d^3*x^6*(a + b*atan(c*x)) + (7*b*d^3*log(1 + c^2*x^2))/(15*c^3)]
