    @test_int [(d + im*c*d*x)^3*(a + b*atan(c*x)), x, 4, (-im)*b*d^3*x - (b*d^3*(1 + im*c*x)^2)/(4*c) - (b*d^3*(1 + im*c*x)^3)/(12*c) - (im*d^3*(1 + im*c*x)^4*(a + b*atan(c*x)))/(4*c) - (2*b*d^3*log(1 - im*c*x))/c]
    @test_int [((d + im*c*d*x)^3*(a + b*atan(c*x)))/x, x, 15, (3*im)*a*c*d^3*x + (3*b*c*d^3*x)/2 + (im/6)*b*c^2*d^3*x^2 - (3*b*d^3*atan(c*x))/2 + (3*im)*b*c*d^3*x*atan(c*x) - (3*c^2*d^3*x^2*(a + b*atan(c*x)))/2 - (im/3)*c^3*d^3*x^3*(a + b*atan(c*x)) + a*d^3*log(x) - ((5*im)/3)*b*d^3*log(1 + c^2*x^2) + (im/2)*b*d^3*PolyLog(2, (-im)*c*x) - (im/2)*b*d^3*PolyLog(2, im*c*x)]
    @test_int [((d + im*c*d*x)^3*(a + b*atan(c*x)))/x^2, x, 16, -3*a*c^2*d^3*x + (im/2)*b*c^2*d^3*x - (im/2)*b*c*d^3*atan(c*x) - 3*b*c^2*d^3*x*atan(c*x) - (d^3*(a + b*atan(c*x)))/x - (im/2)*c^3*d^3*x^2*(a + b*atan(c*x)) + (3*im)*a*c*d^3*log(x) + b*c*d^3*log(x) + b*c*d^3*log(1 + c^2*x^2) - (3*b*c*d^3*PolyLog(2, (-im)*c*x))/2 + (3*b*c*d^3*PolyLog(2, im*c*x))/2]
    @test_int [((d + im*c*d*x)^3*(a + b*atan(c*x)))/x^3, x, 16, -(b*c*d^3)/(2*x) - im*a*c^3*d^3*x - (b*c^2*d^3*atan(c*x))/2 - im*b*c^3*d^3*x*atan(c*x) - (d^3*(a + b*atan(c*x)))/(2*x^2) - ((3*im)*c*d^3*(a + b*atan(c*x)))/x - 3*a*c^2*d^3*log(x) + (3*im)*b*c^2*d^3*log(x) - im*b*c^2*d^3*log(1 + c^2*x^2) - ((3*im)/2)*b*c^2*d^3*PolyLog(2, (-im)*c*x) + ((3*im)/2)*b*c^2*d^3*PolyLog(2, im*c*x)]
    @test_int [((d + im*c*d*x)^3*(a + b*atan(c*x)))/x^4, x, 17, -(b*c*d^3)/(6*x^2) - (((3*im)/2)*b*c^2*d^3)/x - ((3*im)/2)*b*c^3*d^3*atan(c*x) - (d^3*(a + b*atan(c*x)))/(3*x^3) - (((3*im)/2)*c*d^3*(a + b*atan(c*x)))/x^2 + (3*c^2*d^3*(a + b*atan(c*x)))/x - im*a*c^3*d^3*log(x) - (10*b*c^3*d^3*log(x))/3 + (5*b*c^3*d^3*log(1 + c^2*x^2))/3 + (b*c^3*d^3*PolyLog(2, (-im)*c*x))/2 - (b*c^3*d^3*PolyLog(2, im*c*x))/2]
    @test_int [((d + im*c*d*x)^3*(a + b*atan(c*x)))/x^5, x, 4, -(b*c*d^3)/(12*x^3) - ((im/2)*b*c^2*d^3)/x^2 + (7*b*c^3*d^3)/(4*x) - (d^3*(1 + im*c*x)^4*(a + b*atan(c*x)))/(4*x^4) - (2*im)*b*c^4*d^3*log(x) + (2*im)*b*c^4*d^3*log(im + c*x)]
