    @test_int [x^2*(d + im*c*d*x)^4*(a + b*atan(c*x)), x, 4, (((5*im)/3)*b*d^4*x)/c^2 - (88*b*d^4*x^2)/(105*c) - ((5*im)/9)*b*d^4*x^3 + (47*b*c*d^4*x^4)/140 + ((2*im)/15)*b*c^2*d^4*x^5 - (b*c^3*d^4*x^6)/42 + ((im/5)*d^4*(1 + im*c*x)^5*(a + b*atan(c*x)))/c^3 - ((im/3)*d^4*(1 + im*c*x)^6*(a + b*atan(c*x)))/c^3 + ((im/7)*d^4*(1 + im*c*x)^7*(a + b*atan(c*x)))/c^3 + (176*b*d^4*log(im + c*x))/(105*c^3)]
    @test_int [x*(d + im*c*d*x)^4*(a + b*atan(c*x)), x, 4, (-16*b*d^4*x)/(15*c) - (((4*im)/15)*b*d^4*(im - c*x)^2)/c^2 - (4*b*d^4*(im - c*x)^3)/(45*c^2) + ((im/30)*b*d^4*(im - c*x)^4)/c^2 + (b*d^4*(im - c*x)^5)/(30*c^2) + (d^4*(1 + im*c*x)^5*(a + b*atan(c*x)))/(5*c^2) - (d^4*(1 + im*c*x)^6*(a + b*atan(c*x)))/(6*c^2) + (((32*im)/15)*b*d^4*log(im + c*x))/c^2]
    @test_int [(d + im*c*d*x)^4*(a + b*atan(c*x)), x, 4, (-(8/5))*im*b*d^4*x - (2*b*d^4*(1 + im*c*x)^2)/(5*c) - (2*b*d^4*(1 + im*c*x)^3)/(15*c) - (b*d^4*(1 + im*c*x)^4)/(20*c) - (im*d^4*(1 + im*c*x)^5*(a + b*atan(c*x)))/(5*c) - (16*b*d^4*log(1 - im*c*x))/(5*c)]
